import React from 'react';

import { Text, Form, Button, Layout, Banner } from 'react-lifesg-design-system';
import { ThemeProvider } from "styled-components";
import styled from "styled-components";

interface Props {
    onChange: (fieldName: string, value: string) => void;
    onSave: () => void;
}

const StyledContainer = styled(Layout.GridContainer)`
    grid-template-rows: 8fr;
    grid-template-areas:
        "header"
        "buttons"
        "queue";
    text-align: center;
    grid-gap: 0.25rem;
    padding: 20px;

`;

const StyledSection = styled(Layout.Section)`
    margin-top: 8%;
    min-height: 600px;
`;

const NavBar = styled.nav`
  background: #3a3a55;
  grid-area: header;
  padding: 0.25rem;
`;
const Main = styled.main`
  background: #1f2128;
  color: white;
  grid-area: buttons;
  padding: 0.25rem;
`;
const SideBar = styled.div`
  background: #9aaab7;
  grid-area: queue;
  padding: 0.25rem;
`;

const dashboard: React.FunctionComponent<Props> = (props) => {
  return (
      <>
        <StyledSection>
            <StyledContainer>
                <NavBar>NavBar</NavBar>
                <Main>Main</Main>
                <SideBar>SideBar</SideBar>
                <Layout.GridContent>
                    <Text.H3>Add Appointment</Text.H3>
                
                    <Button.Default
                        onClick={props.onSave}
                    >Add</Button.Default>
                </Layout.GridContent>
             

            </StyledContainer>
        </StyledSection>
    </>
  )
}

export default dashboard;
